<script>
	import home from '@/components/home';
	import {
		mapGetters
	} from "vuex";
	import {
		getlevelInfo,
		getlevelExpList
	} from '@/api/user.js';
	export default {
		components: {
			home
		},
		computed: mapGetters(['userInfo']),
		data() {
			return {
				//userInfo: '',
				levelInfo: '',
				levelList: [],
				current: 0,
				widthLen: 0,
				loading: false,
				loadend: false,
				loadTitle: '加载更多', //提示语
				page: 1,
				limit: 20,
				expList: []
			};
		},
		onLoad() {
			this.levelInfo = this.userInfo.experience;
			this.getInfo();
			this.getlevelList();
		},
		methods: {
			getInfo: function() {
				let that = this;
				getlevelInfo().then(res => {
					let levelList = res.data;
					let list = []
					that.levelList = levelList;
					levelList.map((item, index) => {
						if (item.experience <= that.levelInfo) {
							list.push(item.experience)
						}
					})
					let maxn = Math.max.apply(null, list);
					that.current = maxn;
					// 解决len取的值没有时；
					let levelListLen = levelList[list.length] ? levelList[list.length] : levelList[list
						.length - 1];
					// 解决除数不能为0
					let divisor = levelListLen.experience - maxn ? levelListLen.experience - maxn : 1;
					// 每小格所占的百分比
					let per = (that.levelInfo - maxn) / divisor / levelList.length;

					that.widthLen = ((list.length - 0.5) / (levelList.length)) * 100 + per * 100

				}).catch(function(res) {
					return that.$util.Tips({
						title: res
					});
				})
			},
			getlevelList: function() {
				let that = this
				if (this.loadend) return false;
				if (this.loading) return false;
				getlevelExpList({
					page: that.page,
					limit: that.limit
				}).then(res => {
					let list = res.data.list,
						loadend = list.length < that.limit;
					let expList = that.$util.SplitArray(list, that.expList);
					that.$set(that, 'expList', expList);
					that.loadend = loadend;
					that.loadTitle = loadend ? '我也是有底线的' : '加载更多';
					that.page = that.page + 1;
					that.loading = false;
				}).catch(err => {
					that.loading = false;
					that.loadTitle = '加载更多';
				});
			}
		},
		onReachBottom: function() {
			this.getlevelList();
		}
	}
</script>

